import Phaser from 'phaser'
import StateMachine from '../statemachine/StateMachine'
import { sharedInstance as events } from './EventCenter'
import ObstaclesController from './ObstaclesController'

type CursorKeys = Phaser.Types.Input.Keyboard.CursorKeys
export default class PlayerController {
	private scene: Phaser.Scene
	private sprite: Phaser.Physics.Matter.Sprite
	private cursors: CursorKeys
	private attack!: Phaser.Input.Keyboard.Key
	private obstacles: ObstaclesController

	private stateMachine: StateMachine
	private health = 100
	private seeds = 0
	private lastSnowman?: Phaser.Physics.Matter.Sprite

	constructor(scene: Phaser.Scene, sprite: Phaser.Physics.Matter.Sprite, cursors: CursorKeys, keyboard: Phaser.Input.Keyboard.Key, obstacles: ObstaclesController) {
		this.scene = scene
		this.sprite = sprite
		this.cursors = cursors
		this.attack = keyboard
		this.obstacles = obstacles
		this.createAnimations()

		this.stateMachine = new StateMachine(this, 'player')

		this.stateMachine.addState('idle', {
			onEnter: this.idleOnEnter,
			onUpdate: this.idleOnUpdate
		})
			.addState('walk', {
				onEnter: this.walkOnEnter,
				onUpdate: this.walkOnUpdate,
				onExit: this.walkOnExit
			})
			.addState('jump', {
				onEnter: this.jumpOnEnter,
				onUpdate: this.jumpOnUpdate
			})
			.addState('spike-hit', {
				onEnter: this.spikeHitOnEnter
			})
			.addState('snowman-hit', {
				onEnter: this.snowmanHitOnEnter
			})
			.addState('snowman-stomp', {
				onEnter: this.snowmanStompOnEnter
			})
			.addState('dead', {
				onEnter: this.deadOnEnter
			})
			.addState('attack', {
				onEnter: this.attackOnEnter
			})
			.setState('idle')

		this.sprite.setOnCollide((data: MatterJS.ICollisionPair) => {
			const body = data.bodyB as MatterJS.BodyType

			if (this.obstacles.is('spikes', body)) {
				this.stateMachine.setState('spike-hit')
				return
			}

			if (this.obstacles.is('XLow', body) || this.obstacles.is('Y', body) || this.obstacles.is('boss', body) || this.obstacles.is('XHigh', body))
			{
				this.lastSnowman = body.gameObject
				if (this.sprite.y < body.position.y) {
					// stomp on snowman
					this.stateMachine.setState('snowman-stomp')
				}
				else {
					// hit by snowman
					this.stateMachine.setState('snowman-hit')
				}
				return
			}
			if (this.obstacles.is('tree', body)) {
				//do something

				events.emit('waterTree', this.seeds)
				this.seeds = 0
				events.emit('star-collected', this.seeds)
				console.log("ontree")
				return
			}
			const gameObject = body.gameObject

			if (!gameObject) {
				return
			}

			if (gameObject instanceof Phaser.Physics.Matter.TileBody) {
				if (this.stateMachine.isCurrentState('jump')) {
					this.stateMachine.setState('idle')
				}
				return
			}

			const sprite = gameObject as Phaser.Physics.Matter.Sprite
			const type = sprite.getData('type')

			// sprite.setFriction(0.05, 0.1, 0.1)

			switch (type) {
				case 'star':
					{
						const value = sprite.getData('healthPoints') ?? 10
						this.seeds++
						events.emit('star-collected', this.seeds)
						sprite.destroy()
						break
					}


				case 'health':
					{
						const value = sprite.getData('healthPoints') ?? 10
						this.health = Phaser.Math.Clamp(this.health + value, 0, 100)
						events.emit('health-changed', this.health)
						sprite.destroy()
						break
					}
			}
		})
	}

	update(dt: number) {
		this.stateMachine.update(dt)
	}

	private setHealth(value: number) {
		this.health = Phaser.Math.Clamp(value, 0, 100)

		events.emit('health-changed', this.health)

		// TODO: check for death
		if (this.health <= 0) {
			this.stateMachine.setState('dead')
		}
	}

	private idleOnEnter() {
		this.sprite.play('player-idle')
	}

	private idleOnUpdate() {
		if (this.cursors.left.isDown || this.cursors.right.isDown) {
			this.stateMachine.setState('walk')
		}

		const spaceJustPressed = Phaser.Input.Keyboard.JustDown(this.cursors.space)
		if (spaceJustPressed) {
			this.stateMachine.setState('jump')
		}

		const attackJustPressed = Phaser.Input.Keyboard.JustDown(this.attack)
		if (attackJustPressed) {
			this.stateMachine.setState('attack')
		}
	}

	private walkOnEnter() {
		this.sprite.play('player-walk')
	}

	private walkOnUpdate() {
		const speed = 1

		if (this.cursors.left.isDown) {
			this.sprite.flipX = true
			this.sprite.setVelocityX(-speed)
		}
		else if (this.cursors.right.isDown) {
			this.sprite.flipX = false
			this.sprite.setVelocityX(speed)
		}
		else {
			this.sprite.setVelocityX(0)
			this.stateMachine.setState('idle')
		}

		const spaceJustPressed = Phaser.Input.Keyboard.JustDown(this.cursors.space)
		if (spaceJustPressed) {
			this.stateMachine.setState('jump')
		}
	}

	private walkOnExit() {
		this.sprite.stop()
	}

	private jumpOnEnter() {
		this.sprite.setVelocityY(-12)
	}

	private jumpOnUpdate() {
		const speed = 2

		if (this.cursors.left.isDown) {
			this.sprite.flipX = true
			this.sprite.setVelocityX(-speed)
		}
		else if (this.cursors.right.isDown) {
			this.sprite.flipX = false
			this.sprite.setVelocityX(speed)
		}
	}

	private attackOnEnter() {
		// this.sprite.play('player-walk')
		events.emit('snowman-stomped', this.lastSnowman)
		this.stateMachine.setState('idle')
	}

	private spikeHitOnEnter() {
		this.sprite.setVelocityY(-12)

		const startColor = Phaser.Display.Color.ValueToColor(0xffffff)
		const endColor = Phaser.Display.Color.ValueToColor(0xff0000)

		this.scene.tweens.addCounter({
			from: 0,
			to: 100,
			duration: 100,
			repeat: 2,
			yoyo: true,
			ease: Phaser.Math.Easing.Sine.InOut,
			onUpdate: tween => {
				const value = tween.getValue()
				const colorObject = Phaser.Display.Color.Interpolate.ColorWithColor(
					startColor,
					endColor,
					100,
					value
				)

				const color = Phaser.Display.Color.GetColor(
					colorObject.r,
					colorObject.g,
					colorObject.b
				)

				this.sprite.setTint(color)
			}
		})

		this.stateMachine.setState('idle')

		this.setHealth(this.health - 10)
	}

	private snowmanHitOnEnter() {
		if (this.lastSnowman) {
			if (this.sprite.x < this.lastSnowman.x) {
				this.sprite.setVelocityX(-20)
			}
			else {
				this.sprite.setVelocityX(20)
			}
		}
		else {
			this.sprite.setVelocityY(-20)
		}

		const startColor = Phaser.Display.Color.ValueToColor(0xffffff)
		const endColor = Phaser.Display.Color.ValueToColor(0x0000ff)

		this.scene.tweens.addCounter({
			from: 0,
			to: 100,
			duration: 100,
			repeat: 2,
			yoyo: true,
			ease: Phaser.Math.Easing.Sine.InOut,
			onUpdate: tween => {
				const value = tween.getValue()
				const colorObject = Phaser.Display.Color.Interpolate.ColorWithColor(
					startColor,
					endColor,
					100,
					value
				)

				const color = Phaser.Display.Color.GetColor(
					colorObject.r,
					colorObject.g,
					colorObject.b
				)

				this.sprite.setTint(color)
			}
		})

		this.stateMachine.setState('idle')

		this.setHealth(this.health - 25)
	}

	private snowmanStompOnEnter() {
		this.sprite.setVelocityY(-10)

		events.emit('snowman-stomped', this.lastSnowman)
		seeds++


		this.stateMachine.setState('idle')
	}

	private deadOnEnter() {
		this.sprite.play('player-death')

		this.sprite.setOnCollide(() => { })

		this.scene.time.delayedCall(1500, () => {
			this.scene.scene.start('game-over')
		})
	}

	private createAnimations() {
		this.sprite.anims.create({
			key: 'player-idle',
			frames: [{ key: 'penquin', frame: 'penguin_walk01.png' }]
		})

		this.sprite.anims.create({
			key: 'player-walk',
			frameRate: 10,
			frames: this.sprite.anims.generateFrameNames('penquin', {
				start: 1,
				end: 4,
				prefix: 'penguin_walk0',
				suffix: '.png'
			}),
			repeat: -1
		})

		this.sprite.anims.create({
			key: 'player-attack',
			frameRate: 10,
			frames: this.sprite.anims.generateFrameNames('penquin', {
				start: 0,
				end: 1,
				prefix: 'penguin_attack0',
				suffix: '.png',
				zeroPad: 4
			}),
		})

		this.sprite.anims.create({
			key: 'player-death',
			frames: this.sprite.anims.generateFrameNames('penquin', {
				start: 1,
				end: 4,
				prefix: 'penguin_die',
				zeroPad: 2,
				suffix: '.png'
			}),
			frameRate: 10
		})
	}
}
